import React from 'react';


const About = () => {
  return (
    <div>
      
      <h1>About our store</h1>
      <p>We are an online store that offers a wide selection of products at affordable prices. We take pride in the quality of our products and guarantee excellent service to every customer. Our products are delivered anywhere in the world, and we are always ready to help you with your choice!</p>
      <p>Join our store and receive exclusive offers and discounts!</p>
      
    </div>
  );
};

export default About;
